olor = \"white\") +\n","  labs(title= \"Average Amount Per Active Hour by Day\", \n","       x= \" \", y=\"Amount Per Active Hour ($)\") +\n","  theme(plot.title = element_text(hjust = 0.5, size = 18, face = \"bold\", color = \"black\"))\n","\n","\n","\n","avg_tips$day <- factor(avg_tips$day, levels =  c('Mon', 'Tue', 'Wed', 'Thu', 'Fri'))\n","\n","tips_bar <- ggplot(data = avg_tips, aes(x=day, y=tips)) +\n","  geom_col(color = \"black\") + \n","  geom_bar(stat=\"identity\", fill='#7F98A4') + theme_bw() +\n","  geom_text(aes(label = tips), vjust = 2, fontface = \"bold\", color = \"white\") +\n","  labs(title= \"Average Tips by Day\", \n","       x= \" \", y=\"Total Tips ($)\") +\n","  theme(plot.title = element_text(hjust = 0.5, size = 18, face = \"bold\", color = \"black\"))\n","\n","\n","\n","avg_per_delivery$day <- factor(avg_per_delivery$day, levels =  c('Mon', 'Tue', 'Wed', 'Thu', 'Fri'))\n","\n","per_delivery_bar <- ggplot(data = avg_per_delivery, aes(x=day, y=amount_per_delivery)) +\n","  geom_col(color = \"black\") + \n","  geom_bar(stat=\"identity\", fill='#41617d') + theme_bw() +\n","  geom_text(aes(label = amount_per_delivery), vjust = 2, fontface = \"bold\", color = \"white\") +\n","  labs(title= \"Average Amount Per Delivery by Day\", \n","       x= \" \", y=\"Amount Per Delivery ($)\") +\n","  theme(plot.title = element_text(hjust = 0.5, size = 18, face = \"bold\", color = \"black\"))\n","\n","\n","\n","\n","per_hour_bar\n","per_active_hour_bar\n","tips_bar\n","per_delivery_bar"]},{"cell_type":"markdown","id":"6a6a3fd5","metadata":{"papermill":{"duration":0.008622,"end_time":"2022-11-02T13:59:11.304594","exception":false,"start_time":"2022-11-02T13:59:11.295972","status":"completed"},"tags":[]},"source":["**Average amount per hour**\n","* On Wednesdays I made the most average amount per hour, with Mondays in a very close second.\n","* Thursdays I made the least amount at 14.25 an hour, 75 cents less than my minimum goal of 15/hour.\n","\n","\n","**Average amount per active hour**\n","* On Fridays I made the most amount per active hour, meaning that the orders tend to be a higher payout that day. \n","* Mondays I made the least amount.\n","* Thursdays were only 13 cents more than Mondays at a close second to last.\n","\n","**Average tips by day**\n","* Mondays included the most amount of average tips at almost 60.\n","* On Thursdays I made the least amount of average tips at 21.70, 49.2% less than Friday which was second to last at 42.70.\n","\n","**Average amount per delivery**\n","* On Thursdays deliveries were an average higher payout then other days.\n","* Fridays had the lowest average payout per delivery, but only by 12.3% less than Thursdays."]},{"cell_type":"markdown","id":"c9c30f98","metadata":{"papermill":{"duration":0.008674,"end_time":"2022-11-02T13:59:11.321671","exception":false,"start_time":"2022-11-02T13:59:11.312997","status":"completed"},"tags":[]},"source":["# <span style=\"color:#ab0520\"> Conclusions </span>\n","\n","**Mondays** and **Wednesdays** seem to be the best days for dashing in the mornings. Although **Thursdays** had the highest payout per delivery, the payout per hour along with the amount of tips given were drastically lower than other days, making it the least profitable. The evening shift is probably better to do on Thursdays. **Fridays** and **Tuesdays** are mediocre for morning shifts, so I can choose to work either the morning or evening shift on these days.\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":6.298216,"end_time":"2022-11-02T13:59:11.449804","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-02T13:59:05.151588","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}